import React from 'react';
import './Header.css';
import logo from '../../assets/logo.svg';

const Header = function () {
    return (
        <div className="header">
            <span>
            <img src={logo} className='logo'></img>
            </span>
            <Button variant="contained" disableElevation>
                Disable elevation
            </Button>
        </div>
    )
}

export default Header;
